window.bookSummaryJSON = "<p><b>Teddy Fay hedges his bets in the latest thriller from number-one </b><b><i>New York Times </i></b><b>best-selling author Stuart Woods. </b></p> <p>When Peter Barrington and Ben Bachetti come under threat while working at a film festival abroad, Teddy Fay is lured to the glittering city of Macau to resolve the problem. He'll soon come to find that world of posh casinos, luxurious developments, and boundless wealth has a dark underbelly of crime and political intrigue...and that the biggest players behind the scenes may be far closer to home than anticipated.&nbsp;</p> <p>With international deals and private vendettas at stake, the villains behind the plot aren't about to let Teddy stand in their way. What they don't know is that this seemingly harmless film producer has more than a few tricks up his sleeve.</p>"; 
